import React from "react";
import PlayerCard from "./PlayerCard";
import ButtonToPlay from "./ButtonToPlay";

const App = () => {
  return (
    <div className="main-container">
      <div className="main-container__players">
        <PlayerCard />
        <PlayerCard />
      </div>
      <div className="main-container__buttons">
        <ButtonToPlay />
        <ButtonToPlay />
      </div>
    </div>
  );
};

export default App;
